window.addEventListener('load', function(){
	let meaning = document.getElementById("meaning");

	meaning.onclick = function() {
		meaning.classList.remove('displayNone');
		meaning.classList.add('meaning');
		console.log('meaning');
	};

// if (meaning.style.display==='none') {
